import * as React from 'react';
import { NameAndRegion } from './CreateVps/NameAndRegion';

import MultiStep from './MultiStep';

const steps = [
  { component: <NameAndRegion /> },
]

const CreateVpsForm = () => {
  const steps = [
    {title: 'StepOne', component: <StepOne/>},
    {title: 'StepTwo', component: <StepTwo/>},
    {title: 'StepThree', component: <StepThree/>},
    {title: 'StepFour', component: <StepFour/>}
    ];
  
  return (
  <MultiStep activeStep={1} showNavigation={true} steps={steps}/>

  )
};

export default CreateVpsForm
